//import logo from './logo.svg';
//import './App.css';

import Panel from "./components/Panel";
import Link from "./components/Link";

function App() {
  return (
    <div className="panel">
       <Panel />
      <div className="link">
        <Link name="Форум" />
        <Link name="Лента" />
        <Link name="Зарплати" />
        <Link name="Работа" />
        <Link name="Календар" />
      </div>
    </div>
  );
}

export default App;
